'use strict';

// FOOTER //

/**
* FUNCTION: Footer()
*	Footer constructor.
*
* @constructor
* @returns {Footer} Footer instance
*/
function Footer() {
	if ( !( this instanceof Footer ) ) {
		return new Footer();
	}
	return this;
} // end FUNCTION Footer()


// EXPORTS //

module.exports = Footer;
